define({"topics":[{"title":"Joining an instant meeting","shortdesc":"<p class=\"shortdesc\">Anyone with the meeting link can join an instant meeting. Since instant meetings are         unmoderated, any authenticated user can start the meeting. If you're signed in, you can find         your existing instant meetings on the <span class=\"keyword wintitle\">Recent<\/span> tab. To generate a report,         refer to <a class=\"xref\" href=\"t_generate_report.html\">t_generate_report.html<\/a>.<\/p>","href":"c_instant_meetings.html","attributes":{"data-id":"c_instant_meetings"},"menu":{"hasChildren":false},"tocID":"c_instant_meetings-d451e157","topics":[]},{"title":"Joining a moderated meeting","shortdesc":"<p class=\"shortdesc\">This type of meeting limits control to the owner or designated moderators. By default,     guests can join an existing meeting. Unless <span class=\"ph uicontrol\">Moderated<\/span> is enabled, any     authenticated user can start the meeting. Otherwise, the meeting owner or moderator must start     the meeting first before other users can join. For more information on how to create and manage     your meetings, refer to <a class=\"xref\" href=\"t_create_moderated.html\">t_create_moderated.html<\/a> and <a class=\"xref\" href=\"participant_list.html\">participant_list.html<\/a>. If the meeting has started and waiting room is enabled, then     participants must be admitted into the meeting first before being able to select       <span class=\"ph uicontrol\">Join<\/span> from the preview window. <\/p>","href":"c_meetings_moderated.html","attributes":{"data-id":"meetings_moderated"},"menu":{"hasChildren":false},"tocID":"meetings_moderated-d451e181","topics":[]},{"title":"Inviting meeting participants by phone","shortdesc":"<p class=\"shortdesc\">When the dial-out option is enabled, moderators can invite users to join a meeting by         phone.<\/p>","href":"t_dialout_invite.html","attributes":{"data-id":"t_dialout_invite"},"menu":{"hasChildren":false},"tocID":"t_dialout_invite-d451e210","topics":[]},{"title":"Setting up audio conferencing (dial in)","shortdesc":"<p class=\"shortdesc\">When configured, you can dial in to a Sametime meeting without a computer or internet     connection.  <\/p>","href":"c_meetings_telephony.html","attributes":{"data-id":"c_meetings_telephony"},"menu":{"hasChildren":false},"tocID":"c_meetings_telephony-d451e229","topics":[]}]});